let user = { user: "ajay", password: "1234" };

router.get('/home', (req, res) => {
  let sess = req.session.user
  if (sess) {
    res.render('home', { name: sess, car });
  } else {
    res.redirect('/')
  }
});

router.post('/home', (req, res) => {
  if (req.body.name == user.user && req.body.password == user.password) {
    req.session.user = req.body.name;
    // res.render('home', { car });
    
    res.send({status:true});
  }

  else {
    // res.redirect('/');
    res.send({status:false});
  }
});


router.get('/logout', (req, res) => {
  req.session.destroy();
  res.redirect('/');
});

module.exports = router;





















